import App from './App';
import {  Routes,Route} from 'react-router-dom';

import Projects from './Project2';
function App2(){
return(
<>

<Routes>
{/* <Switch> */}
  <Route path="/" element={<App/>}></Route>
  <Route path="/project" element={<Projects/>}></Route>
{/* </Switch> */}
</Routes>
</>
)
}
export default App2
